def train_test_sep(index, train_test_sep, config_list, train_xlist, train_ylist, test_xlist, test_ylist):
    for i in range(1, int(train_test_sep*len(config_list))):#len(config_list))):
        temp_file = dir_path + str(index) + "\\pic_" + str(i) + "_org.png"
        train_xlist.append(temp_file)
        train_ylist.append(unique_best_config_list.index(config_list[i]))
    for i in range(int(train_test_sep*len(config_list))+1, len(config_list)-1): #(int(train_test_sep*len(config_list))+1, len(config_list)-1)
        test_ylist.append(unique_best_config_list.index(config_list[i]))
        temp_file = dir_path + str(index) + "\\pic_" + str(i) + "_org.png"
        test_xlist.append(temp_file)
        frame_list.append(i+1)
        index_list.append(index)
    return train_xlist, train_ylist, test_xlist, test_ylist
    
def compute_pc(file_list):
    #applying pca to a bunch of images
    immatrix = np.array([np.array(Image.open(im, 'r')).flatten() for im in file_list], 'f')
    """
    for im in file_list:
        x= np.array(Image.open(im, 'r')).flatten()
        print(im)
        print(x.size,x.shape)
    """
    #Standardizing the features
    x = StandardScaler().fit_transform(immatrix)
    return x
    


